drop table lab;
create table lab (
	id INT,
	lab_item_code VARCHAR(50),
	lab_item_name VARCHAR(50),
	charttime DATE,
	value DECIMAL(4,2),
	unit VARCHAR(5),
	patient_id INT,
	visit_id INT,
	PRIMARY KEY(id),
	CONSTRAINT fk_patient
	FOREIGN KEY(patient_id) 
	  REFERENCES patient(id),
	  CONSTRAINT fk_visit
	FOREIGN KEY(visit_id) 
	  REFERENCES visit(id)
);
COMMENT ON TABLE lab IS 'Contains all laboratory measurements for a given patient, including out patient data.';
COMMENT ON COLUMN lab.lab_item_code IS 'Identifier for a single measurement type in the database. Each row associated with one lab_item_code corresponds to an instantiation of the same measurement (e.g. heart rate).';
COMMENT ON COLUMN lab.lab_item_name IS 'The lab_item_name column describes the concept which is represented by the lab_item_code.';
COMMENT ON COLUMN lab.charttime IS 'charttime records the time at which an observation was charted, and is usually the closest proxy to the time the data was actually measured. ';
COMMENT ON COLUMN lab.value IS 'value contains the value measured for the concept identified by the lab_item_code';
COMMENT ON COLUMN lab.unit IS 'unit specifies the unit of measurement used for the lab_item_code';
COMMENT ON COLUMN lab.patient_id IS 'patient_id is a unique identifier which specifies an individual patient.';
COMMENT ON COLUMN lab.visit_id IS 'visit_id represents a single patientâ€™s admission to the hospital.';

